import React from "react";
import ReactDOM from "react-dom";

const name = "Kenan";
const img = "https://picsum.photos/200"



ReactDOM.render(
  <div>
  <h1 className = "heading" contentEditable = "true" spellCheck = "false">Created by {name}</h1>
  <img src={img}></img>
</div>,
document.getElementById("root"));
